import "../App.css";
import { useState } from "react";
// Import your API function here
// import { bookAppointmentAPI } from "../services/api";

function BookAppointment() {
  const [formData, setFormData] = useState({
    fullName: "",
    email: "",
    phone: "",
    gender: "",
    age: "",
    department: "",
    doctor: "",
    appointmentDate: "",
    appointmentTime: "",
    visitType: "",
    reasonForVisit: "",
    symptoms: "",
  });

  // Replace this with your actual API function
  const bookAppointmentAPI = async (data) => {
    // Example using fetch (replace URL with your backend endpoint)
    const response = await fetch("http://localhost:5000/appointments", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(data),
    });
    return response.json();
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await bookappointment(formData); // call API
      if (response.success) {
        alert("Appointment Booked Successfully!");
        window.location.href = "/myappointment";
      } else {
        alert("Failed to book appointment: " + response.message);
      }
    } catch (error) {
      console.error(error);
      alert("Something went wrong!");
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <section className="container my-5">
      <div className="row justify-content-center">
        <div className="col-lg-9 col-md-11">
          <div className="card shadow-lg p-4 border-0">
            <h2 className="text-center text-primary fw-bold mb-4">
              Book Doctor Appointment
            </h2>

            <form onSubmit={handleSubmit}>
              {/* PATIENT DETAILS */}
              <h5 className="mb-3">Patient Details</h5>
              <div className="row">
                <div className="col-md-6 mb-3">
                  <label className="form-label">Full Name</label>
                  <input
                    type="text"
                    className="form-control"
                    name="fullName"
                    value={formData.fullName}
                    onChange={handleChange}
                    placeholder="Enter full name"
                    required
                  />
                </div>

                <div className="col-md-6 mb-3">
                  <label className="form-label">Email</label>
                  <input
                    type="email"
                    className="form-control"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    placeholder="Enter email"
                    required
                  />
                </div>

                <div className="col-md-6 mb-3">
                  <label className="form-label">Phone Number</label>
                  <input
                    type="tel"
                    className="form-control"
                    name="phone"
                    value={formData.phone}
                    onChange={handleChange}
                    placeholder="Enter phone number"
                    required
                  />
                </div>

                <div className="col-md-3 mb-3">
                  <label className="form-label">Gender</label>
                  <select
                    className="form-select"
                    name="gender"
                    value={formData.gender}
                    onChange={handleChange}
                  >
                    <option value="">Select</option>
                    <option value="Male">Male</option>
                    <option value="Female">Female</option>
                    <option value="Other">Other</option>
                  </select>
                </div>

                <div className="col-md-3 mb-3">
                  <label className="form-label">Age</label>
                  <input
                    type="number"
                    className="form-control"
                    name="age"
                    value={formData.age}
                    onChange={handleChange}
                    placeholder="Age"
                  />
                </div>
              </div>

              {/* APPOINTMENT DETAILS */}
              <h5 className="mt-4 mb-3">Appointment Details</h5>
              <div className="row">
                <div className="col-md-6 mb-3">
                  <label className="form-label">Department</label>
                  <select
                    className="form-select"
                    name="department"
                    value={formData.department}
                    onChange={handleChange}
                  >
                    <option value="">Select Department</option>
                    <option value="General Physician">General Physician</option>
                    <option value="Cardiology">Cardiology</option>
                    <option value="Dermatology">Dermatology</option>
                    <option value="Orthopedic">Orthopedic</option>
                  </select>
                </div>

                <div className="col-md-6 mb-3">
                  <label className="form-label">Doctor</label>
                  <select
                    className="form-select"
                    name="doctor"
                    value={formData.doctor}
                    onChange={handleChange}
                  >
                    <option value="">Select Doctor</option>
                    <option value="Dr. Aisha Patel">Dr. Aisha Patel</option>
                    <option value="Dr. Rahul Mehta">Dr. Rahul Mehta</option>
                    <option value="Dr. Neha Shah">Dr. Neha Shah</option>
                  </select>
                </div>

                <div className="col-md-4 mb-3">
                  <label className="form-label">Appointment Date</label>
                  <input
                    type="date"
                    className="form-control"
                    name="appointmentDate"
                    value={formData.appointmentDate}
                    onChange={handleChange}
                  />
                </div>

                <div className="col-md-4 mb-3">
                  <label className="form-label">Appointment Time</label>
                  <input
                    type="time"
                    className="form-control"
                    name="appointmentTime"
                    value={formData.appointmentTime}
                    onChange={handleChange}
                  />
                </div>

                <div className="col-md-4 mb-3">
                  <label className="form-label">Visit Type</label>
                  <select
                    className="form-select"
                    name="visitType"
                    value={formData.visitType}
                    onChange={handleChange}
                  >
                    <option value="">Select Visit Type</option>
                    <option value="Offline">Offline (Clinic)</option>
                    <option value="Online">Online (Video Call)</option>
                  </select>
                </div>
              </div>

              {/* MEDICAL INFO */}
              <h5 className="mt-4 mb-3">Medical Information</h5>
              <div className="mb-3">
                <label className="form-label">Reason for Visit</label>
                <input
                  type="text"
                  className="form-control"
                  name="reasonForVisit"
                  value={formData.reasonForVisit}
                  onChange={handleChange}
                  placeholder="Eg. Fever, Checkup"
                />
              </div>

              <div className="mb-4">
                <label className="form-label">Symptoms / Notes</label>
                <textarea
                  className="form-control"
                  rows="3"
                  name="symptoms"
                  value={formData.symptoms}
                  onChange={handleChange}
                  placeholder="Describe symptoms (optional)"
                ></textarea>
              </div>

              {/* SUBMIT */}
              <div className="text-center">
                <button type="submit" className="btn btn-primary px-5 py-2">
                  Confirm Appointment
                </button>
              </div>
            </form>
          </div>
        </div>
